create table pins
(
    id            bigint           not null
        constraint pins_pkey
            primary key,
    creation_date timestamp        not null,
    latitude      double precision not null,
    longitude     double precision not null,
    type          bigint           not null
        constraint fkjv3k5cdyag8lyjtym2teruluc
            references types
            on delete cascade,
    creation_user varchar(255)
        constraint fkcmfp4avd369iporoc0wul4wvf
            references users
);

alter table pins
    owner to postgres;

